(15864, 'https://ia.media-imdb.com/images/M/MV5BNjU0Mzg1ODg0Ml5BMl5BanBnXkFtZTcwODY1MTAwMQ@@._V1._SX100_SY134_.jpg', 'The Gold Rush', '1925', 'USA', 'English', 95, 'The Tramp goes the Klondike in search of gold and finds it and more.', 'Adventure, Comedy, Family, Romance, Western', 'Charles Chaplin, Mack Swain', 'Charles Chaplin', 1),
(17136, 'https://ia.media-imdb.com/images/M/MV5BMTI2ODk3ODIzNV5BMl5BanBnXkFtZTcwMDk0MTYxMQ@@._V1._SX100_SY135_.jpg', 'Metropolis', '1927', 'Germany', 'German', 153, 'In a futuristic city sharply divided between the working class and the city planners, the son of the city\'s mastermind falls in love with a working class prophet who predicts the coming of a savior to mediate their differences.', 'Action, Adventure, Drama, Fantasy, Romance, Sci-Fi, Thriller', 'Alfred Abel, Gustav Fröhlich, Rudolf Klein-Rogge, Theodor Loos, Heinrich George, Brigitte Helm', 'Fritz Lang', 2),
(17925, 'https://ia.media-imdb.com/images/M/MV5BNjY3MTU2NzUyN15BMl5BanBnXkFtZTcwOTA1MzgyMQ@@._V1._SX98_SY140_.jpg', 'The General', '1926', 'USA', '', 107, 'When Union spies steal an engineer\'s beloved locomotive, he pursues it single handedly and straight through enemy lines.', 'Comedy, Romance, War, Action', 'Marion Mack, Buster Keaton', 'Clyde Bruckman', 3),
(18455, 'https://ia.media-imdb.com/images/M/MV5BMTIwMjM5ODI1Nl5BMl5BanBnXkFtZTcwMDcwOTQyMQ@@._V1._SX98_SY140_.jpg', 'Sunrise: A Song of Two Humans', '1927', 'USA', '', 94, 'A married farmer falls under the spell of a slatternly woman from the city, who tries to convince him to drown his wife.', 'Drama, Romance, Crime', 'George O\'Brien, Janet Gaynor, Margaret Livingston', 'F.W. Murnau', 1),
(20629, 'https://ia.media-imdb.com/images/M/MV5BMTA1MTMxMDA5ODVeQTJeQWpwZ15BbWU2MDI0MzM5OQ@@._V1._SX88_SY140_.jpg', 'All Quiet on the Western Front', '1930', 'USA', 'English', 145, 'A young soldier faces profound disillusionment in the soul-destroying horror of World War I.', 'Action, Drama, War', 'Louis Wolheim, Lew Ayres, Arnold Lucy, Ben Alexander, Scott Kolk, William Bakewell, Richard Alexander, Harold Goodwin, Slim Summerville', 'Lewis Milestone', 1),
(21749, 'https://ia.media-imdb.com/images/M/MV5BMTk3Nzg1MTcxN15BMl5BanBnXkFtZTcwNjg5MDU5Mg@@._V1._SX100_SY134_.jpg', 'City Lights', '1931', 'USA', '', 83, 'The Tramp struggles to help a blind flower girl he has fallen in love with.', 'Comedy, Drama, Romance', 'Charles Chaplin', 'Charles Chaplin', 2),
(22100, 'https://ia.media-imdb.com/images/M/MV5BMTIwNDU4OTI2MF5BMl5BanBnXkFtZTcwNzI5MjcyMQ@@._V1._SX100_SY140_.jpg', 'M', '2023', 'Germany', 'German', 117, 'When the police in a German city are unable to catch a child-murderer, other criminals join in the manhunt.', 'Crime, Thriller', 'Peter Lorre, Ellen Widmann, Otto Wernicke, Theodor Loos', 'Fritz Lang', 2),
(23969, 'https://ia.media-imdb.com/images/M/MV5BMTI5NjQyMzc1NV5BMl5BanBnXkFtZTcwMDQ3NTYyMQ@@._V1._SX100_SY133_.jpg', 'Duck Soup', '1933', 'USA', 'English', 68, 'Rufus T. Firefly is named president/dictator of bankrupt Freedonia and declares war on neighboring Sylvania over the love of wealthy Mrs. Teasdale.', 'Comedy, Musical', 'Groucho Marx, Harpo Marx, Chico Marx, Zeppo Marx, Margaret Dumont, Raquel Torres, Louis Calhern', 'Leo McCarey', 1),
(24216, 'https://ia.media-imdb.com/images/M/MV5BMTU2NjYxNjYyMl5BMl5BanBnXkFtZTcwNDUzNDIzMQ@@._V1._SX100_SY118_.jpg', 'King Kong', '1933', 'USA', 'English', 100, 'A movie crew goes to a tropical island for an exotic location shoot and discovers a colossal giant gorilla who takes a shine to their female blonde star.', 'Action, Adventure, Fantasy, Horror, Romance, Sci-Fi', 'Fay Wray, Robert Armstrong, Bruce Cabot, Frank Reicher, Noble Johnson, King Kong', '', 1),
(25316, 'https://ia.media-imdb.com/images/M/MV5BMTIwMTc1OTAyOV5BMl5BanBnXkFtZTcwNjM1NDEyMQ@@._V1._SX100_SY136_.jpg', 'It Happened One Night', '1934', 'USA', 'English', 105, 'A spoiled heiress, running away from her family, is helped by a man who\'s actually a reporter looking for a story. But then he falls for her...', 'Comedy, Romance', '', 'Frank Capra', 1),
(27977, 'https://ia.media-imdb.com/images/M/MV5BMjE0NDM4NDcyOF5BMl5BanBnXkFtZTcwNjc1MTAwMQ@@._V1._SX100_SY134_.jpg', 'Modern Times', '1936', 'USA', 'English', 87, 'The Tramp struggles to live in modern industrial society with the help of a young homeless woman.', 'Comedy, Drama, Romance', 'Charles Chaplin, Paulette Goddard, Henry Bergman, Tiny Sandford, Hank Mann, Stanley Blystone, Al Ernest Garcia, Cecil Reynolds, Murdock MacQuarrie, Edward LeSaint', 'Charles Chaplin', 1),
(29583, 'https://ia.media-imdb.com/images/M/MV5BMTc5NzMxMTY2Nl5BMl5BanBnXkFtZTcwMzEyODY4Mg@@._V1._SX100_SY120_.jpg', 'Snow White and the Seven Dwarfs', '1937', 'USA', 'English', 83, 'Snow White, pursued by a jealous queen, hides with the Dwarfs; the queen feeds her a poison apple, but Prince Charming awakens her with a kiss.', 'Animation, Family, Fantasy, Musical, Romance', 'Roy Atwell, Stuart Buchanan, Adriana Caselotti, Eddie Collins, Pinto Colvig, Billy Gilbert, Otis Harlan, Lucille La Verne, James MacDonald, Scotty Mattraw, Moroni Olsen, Harry Stockwell', 'David Hand', 1),
